import { useEffect } from 'react'
import { useState } from 'react'

export const Hello = () => {

    const [initialState, setInitialState] = useState("")

    useEffect(() => {
        fetch('/api/').then(res => {
            if (res.ok) {
                return res
            }   
        }).then(jsonResponse => setInitialState(jsonResponse.hello))
    }, [])


    // console.log(initialState);
